INSERT INTO `oc_t_pages_description` (`fk_i_pages_id`, `fk_c_locale_code`, `s_title`, `s_text`) VALUES
(1, 'pt_BR', '{WEB_TITLE} - Alguém tem uma pergunta sobre seus anúncios.', '<p>Olá {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) Deixou uma mensagem sobre seus anúncios <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>:</p><p>{COMMENT}</p><p>Atenciosamente,</p><p>{WEB_LINK}</p>'),
(2, 'pt_BR', 'Por favor valide sua conta no {WEB_TITLE} ', '<p>Olá {USER_NAME},</p><p>Por favor valide seu registro clicando em: {VALIDATION_LINK}</p><p>Muito obrigado!</p><p>Atenciosamente,</p><p>{WEB_LINK}</p>'),
(3, 'pt_BR', '{WEB_TITLE} - Registrado com sucesso!', '<p>Hi {USER_NAME},</p><p>You\'ve successfully registered for {WEB_LINK}.</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(4, 'pt_BR', 'Olha o que eu descobre em {WEB_TITLE}', '<p>Olá {FRIEND_NAME},</p><p>Seu amigão {USER_NAME} gostaria de compartilhas este anúncio com você <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Mensagem:</p><p>{COMMENT}</p><p>Atenciosamente,</p><p>{WEB_TITLE}</p>'),
(5, 'pt_BR', '{WEB_TITLE} - Novos anúncios in the last hour', '<p>Olá {USER_NAME},</p><p>Novos anúncios foram publicados nas últimas horas. De uma olhada:</p><p>{ADS}</p><p>-------------</p><p>Para anular a inscrição neste alerta, click em: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(6, 'pt_BR', '{WEB_TITLE} - Novos anúncios in the last day', '<p>Olá {USER_NAME},</p><p>Novos anúncios foram publicados no último dia. De uma olhada:</p><p>{ADS}</p><p>-------------</p><p>Para anular a inscrição neste alerta, click em: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(7, 'pt_BR', '{WEB_TITLE} - Novos anúncios in the last week', '<p>Olá {USER_NAME},</p><p>Novos anúncios foram publicados na última semana. De uma olhada em:</p><p>{ADS}</p><p>-------------</p><p>Para anular a inscrição neste alerta, click em: {UNSUB_LINK}</p><p>{WEB_LINK}</p>	'),
(8, 'pt_BR', '{WEB_TITLE} - Novos anúncios', '<p>Olá {USER_NAME},</p><p>Um novo anúncio foi publicado, confira!</p><p>{ADS}</p><p>-------------</p><p>Para anular a inscrição neste alerta, click em: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(9, 'pt_BR', '{WEB_TITLE} - Novo comentário', '<p>Someone commented on the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Commenter: {COMMENT_AUTHOR}<br />Commenter\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p>'),
(10, 'pt_BR', '{WEB_TITLE} - Editar opções para o anúncio {ITEM_TITLE}', '<p>Hi {USER_NAME},</p><p>You\'re not registered at {WEB_LINK}, but you can still edit or delete the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> for a short period of time.</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>If you register as a user, you will have full access to editing options.</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(11, 'pt_BR', '{WEB_TITLE} - Valide seu anúncio', '<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because a listing has been published at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this email.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(12, 'pt_BR', '{WEB_TITLE} - Um novo anúncio foi publicado', '<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a listing has been published at {WEB_LINK}.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact email: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>You can edit this listing by clicking on the following link: {EDIT_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(13, 'pt_BR', '{WEB_TITLE} - Recupere sua senha', '<p>Hi {USER_NAME},</p><p>We\'ve sent you this e-mail because you\'ve requested a password reminder. Follow this link to recover it: {PASSWORD_LINK}</p><p>The link will be deactivated in 24 hours.</p><p>If you didn\'t request a password reminder, please ignore this message. This request was made from IP {IP_ADDRESS} on {DATE_TIME}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(14, 'pt_BR', '{WEB_TITLE} - Sua requisição de troca de e-mail', '<p>Hi {USER_NAME}</p><p>You\'re receiving this e-mail because you requested an e-mail change. Please confirm this new e-mail address by clicking on the following validation link: {VALIDATION_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(15, 'pt_BR', '{WEB_TITLE} - Por favor valide sua inscrição', '<p>Olá {USER_NAME},</p><p>Por favor valide seu registro de inscrição clicando no link abaixo: {VALIDATION_LINK}</p><p>Obrigado!</p><p>Atenciosamente,</p><p>{WEB_LINK}</p>'),
(16, 'pt_BR', '{WEB_TITLE} - Seu comentário foi aprovado', '<p>Olá {COMMENT_AUTHOR},</p><p>O seu comentário sobre <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>foi aprovado.</p><p>Atenciosamente,</p><p>{WEB_LINK}</p>'),
(17, 'pt_BR', '{WEB_TITLE} - Valide seu anúncio', '<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because you’ve published a listing at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this e-mail.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Even if you\'re not registered at {WEB_LINK}, you can still edit or delete your listing:</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(18, 'pt_BR', '{WEB_TITLE} - Um novo usuário foi registrado', '<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a new user has been created at {WEB_LINK}.</p><p>User details:</p><p>Name: {USER_NAME}<br />E-mail: {USER_EMAIL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(19, 'pt_BR', '{WEB_TITLE} - Alguém tem perguntas para você', '<p>Olá {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) deixou uma mensagem para você:</p><p>{COMMENT}</p><p>Atenciosamente,</p><p>{WEB_LINK}</p>'),
(20, 'pt_BR', '{WEB_TITLE} - Alguém comentou seu anúncio', '<p>There\'s a new comment on the listing: <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Author: {COMMENT_AUTHOR}<br />Author\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p><p>{WEB_LINK}</p>'),
(21, 'pt_BR', '{WEB_TITLE} - Sucesso criar conta de administrador!', '<p>Olá {ADMIN_NAME},</p><p> O administrator {WEB_LINK} criou uma conta para você,</p><ul><li>Username: {USERNAME}</li><li>Password: {PASSWORD}</li></ul><p>Você pode acessar o painel de administração aqui  {WEB_ADMIN_LINK}.</p><p>Obrigado</p><p>Saudações,</p>'),
(22, 'pt_BR', '{WEB_TITLE} - Seu anúncio está prestes a expirar', '<p>Olá {USER_NAME},</p><p>Sua lista <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> está prestes a expirar em {WEB_LINK}.');
